import {useRouter} from "next/router";
import React from "react";
import HeaderBar from "../../components/nav/HeaderBar";
import Typography from "@material-ui/core/Typography";
import GetPhotos from "../../components/Photos/GetPhotos";

export async function getServerSideProps(context){
    let page = context.query.page;
    //let photosArray = await GetPhotos(page);
    let photosArray = page;
    return{props:{photosArray}}
}

const Page = ({photosArray}) => {
    const router = useRouter();
    //const postsList = MakeGallery(photosArray);

    //get username for page heading
    let userName = 'Facebook Page does not exist!';
    if(postsArray[0] !== undefined){
        userName = 'user'
    }

    return (
        <div>
            <HeaderBar/>
            <div>
                <div className='pagetitle'>
                    <Typography align='center' variant={'h4'}>{userName}</Typography>
                </div>
                <div>
                    {}
                </div>
            </div>
        </div>
    );
};

export default Page;
